import React from 'react'

const cards = ({ data }) => {
    return (
        <>
         <div className="shoping_container">
             <div className="arrow_icon">
                 <img src="./image/arrow.png" alt="image" />
             </div>
         </div>
        </>
    )
}

export default cards;
